import React from "react";
import Common from "./Common";
import web from "../src/images/aboutUs.jpg";

const Blogs = () => {
  return (
    <>
      <Common
        name="Welcome to Blogs Page"
        imgsrc={web}
        visit="/contact"
        btnname="Contact Now"
      />
    </>
  );
};

export default Blogs;
